<!DOCTYPE html><html><head><meta charset=utf-8><title>Crabviz Detailed</title><style>:root {
  --background-color: #f5fffa;

  --selected-color: #4fe1f4;

  --edge-color: #548f9e;
  --edge-incoming-color: #698b69;
  --edge-outgoing-color: #008acd;
  --edge-incoming-outgoing-color: black;

  --cluster-label-bg-color: #e8eaed;

  --node-bg-color: #f4f5f1;

  --symbol-default-bg-color: var(--node-bg-color);
  --symbol-default-border-color: #889f4e;
  --symbol-default-text-color: #363636;

  --interface-bg-color: #fff8dc;
  --interface-border-color: #a69348;

  --module-bg-color: #ffebcd;
  --module-border-color: #a67e43;

  --constructor-bg-color: #ffdab9;
  --constructor-border-color: #a66e3c;

  --method-bg-color: #fff8c5;
  --method-border-color: #d4a72c;
  /* --method-text-color: #9a6700; */

  --function-bg-color: #bafbd0;
  --function-border-color: #4ac26b;

  --struct-bg-color: #ddf4ff;
  --struct-border-color: #54aeff;
  /* --struct-text-color: #8969da; */

  --type-icon-color: #8969da;
  --property-icon-color: #5f9348;
}
.callgraph {
  --bold-border: 3.2;

  width: 100%;
  height: 100%;
  outline: none;

  cursor: default;

  user-select: none;

  & > #graph0 {
    & > polygon:first-of-type {
      fill: var(--background-color);
    }

    & > #faded-group {
      & > :where(.node, .cluster) {
        opacity: 0.2;
      }

      & > .edge {
        opacity: 0.05;
      }
    }
  }

  .edge {
    & > path:not(.hover-path) {
      stroke: var(--edge-color);
      stroke-width: 3;
    }
    & > polygon {
      stroke: var(--edge-color);
      fill: var(--edge-color);
    }
    & > path.hover-path {
      stroke: transparent;
      stroke-width: 15;
    }

    &.impl {
      & > path {
        stroke-dasharray: 8, 3;
      }
      & > polygon {
        stroke-width: 2;
        fill: none !important;
      }
    }

    &:hover {
      --edge-color: var(--selected-color);
    }
    &.incoming {
      --edge-color: var(--edge-incoming-color);
    }
    &.outgoing {
      --edge-color: var(--edge-outgoing-color);
    }
    &.incoming.outgoing {
      --edge-color: var(--edge-incoming-outgoing-color);
    }
  }

  .cluster {
    polygon {
      stroke-width: 1.6;
    }

    .cluster-label {
      cursor: pointer;
      fill: var(--cluster-label-bg-color);
      rx: 18px;
    }

    text {
      pointer-events: none;
    }

    &.selected {
      polygon {
        stroke-width: var(--bold-border);
        stroke: var(--selected-color);
      }

      --cluster-label-bg-color: color-mix(in srgb, var(--selected-color) 30%, transparent);
    }
  }

  .node {
    & > rect {
      rx: 20px;
      fill: var(--node-bg-color);
      filter: url(#shadow);
    }
    &.selected > rect {
      stroke: var(--selected-color);
      stroke-width: var(--bold-border);
    }

    & > .title {
      cursor: pointer;

      & > text {
        font-weight: bold;
      }
    }
  }

  .cell {
    --bg-color: var(--symbol-default-bg-color);
    --border-color: var(--symbol-default-border-color);
    --border-width: 1.6;

    & > rect {
      rx: 10px;
      fill: var(--bg-color);
      stroke: var(--border-color);
      stroke-width: var(--border-width);
    }
    & > text {
      fill: var(--symbold-default-text-color);
    }

    &:where(.highlight, .selected, :not(:has(> .cell:hover)):hover) {
      --border-width: var(--bold-border);
    }

    &.highlight > rect {
      stroke: url(#highlightGradient);
    }
    &.selected > rect {
      filter: drop-shadow(3px 3px 6px var(--border-color));
    }

    /* symbols */

    &.interface {
      --bg-color: var(--interface-bg-color);
      --border-color: var(--interface-border-color);

      & > rect {
        stroke-dasharray: 7, 5;
      }
    }

    &.module {
      --bg-color: var(--module-bg-color);
      --border-color: var(--module-border-color);
    }
    &.constructor {
      --bg-color: var(--constructor-bg-color);
      --border-color: var(--constructor-border-color);
    }
    &.function {
      --bg-color: var(--function-bg-color);
      --border-color: var(--function-border-color);
    }
    &.method {
      --bg-color: var(--method-bg-color);
      --border-color: var(--method-border-color);
    }
    &:where(.class, .struct, .enum) {
      --bg-color: var(--struct-bg-color);
      --border-color: var(--struct-border-color);

      & > rect {
        rx: unset;
      }

      & > text {
        transform: translateY(1.5px);

        &:first-of-type {
          fill: var(--type-icon-color);
        }
      }
    }
    &:where(.field, .property) {
      & > rect {
        rx: unset;
      }

      & > text:first-of-type {
        font-style: italic;
        fill: var(--property-icon-color);
      }
    }
  }
}

<script type=module>// Lightweight interaction layer for exported Crabviz HTML graphs.
// Features: pan (drag background), zoom (ctrl+wheel), node/cell selection, edge highlighting,
// fade non-selected nodes, VS Code navigation messages.
class InlineCallGraph {
    svg;
    root;
    scale = 1;
    panX = 0;
    panY = 0;
    dragging = false;
    lastClientX = 0;
    lastClientY = 0;
    edges = [];
    constructor(svg) {
        this.svg = svg;
        this.root = svg.querySelector('#graph0');
        this.edges = Array.from(svg.querySelectorAll('g.edge'));
        this.initPanZoom();
        this.bindClicks();
    }
    initPanZoom() {
        if (!this.root)
            return;
        const svg = this.svg;
        svg.addEventListener('wheel', e => {
            if (!e.ctrlKey)
                return;
            e.preventDefault();
            const ds = Math.exp(-e.deltaY * 0.001);
            const rect = svg.getBoundingClientRect();
            const cx = e.clientX - rect.left;
            const cy = e.clientY - rect.top;
            this.panX = cx - (cx - this.panX) * ds;
            this.panY = cy - (cy - this.panY) * ds;
            this.scale *= ds;
            this.apply();
        }, { passive: false });
        svg.addEventListener('mousedown', e => {
            if (e.button !== 0)
                return;
            this.dragging = true;
            this.lastClientX = e.clientX;
            this.lastClientY = e.clientY;
        });
        window.addEventListener('mouseup', () => { this.dragging = false; });
        window.addEventListener('mousemove', e => {
            if (!this.dragging)
                return;
            this.panX += e.clientX - this.lastClientX;
            this.panY += e.clientY - this.lastClientY;
            this.lastClientX = e.clientX;
            this.lastClientY = e.clientY;
            this.apply();
        });
    }
    apply() {
        if (!this.root)
            return;
        this.root.setAttribute('transform', `matrix(${this.scale} 0 0 ${this.scale} ${this.panX} ${this.panY})`);
    }
    bindClicks() {
        this.svg.addEventListener('click', e => {
            let el = e.target;
            while (el && el instanceof SVGElement && !el.classList.contains('cell') && !el.classList.contains('node') && !el.classList.contains('edge'))
                el = el.parentNode;
            if (!el)
                return;
            e.preventDefault();
            this.clearSelection();
            if (el.classList.contains('cell'))
                this.selectCell(el);
            else if (el.classList.contains('node'))
                this.selectNode(el);
            else if (el.classList.contains('edge'))
                el.classList.add('selected');
        });
    }
    clearSelection() {
        this.svg.querySelectorAll('.selected').forEach(e => e.classList.remove('selected'));
        const faded = this.svg.getElementById('faded-group');
        if (faded && this.root) {
            [...faded.children].forEach(c => this.root.appendChild(c));
        }
        this.edges.forEach(e => e.classList.remove('incoming', 'outgoing'));
    }
    selectNode(node) {
        node.classList.add('selected');
        const id = node.id;
        this.highlightEdges(ed => [ed.dataset.to?.startsWith(id + ':') || false, ed.dataset.from?.startsWith(id + ':') || false]);
        this.fadeAllExcept(new Set([id]));
    }
    selectCell(cell) {
        cell.classList.add('selected');
        const node = cell.closest('.node');
        if (node)
            this.fadeAllExcept(new Set([node.id]));
        this.highlightEdges(ed => [ed.dataset.to === cell.id, ed.dataset.from === cell.id]);
        this.navigate(cell);
    }
    fadeAllExcept(keep) {
        if (!this.root)
            return;
        let faded = this.svg.getElementById('faded-group');
        if (!faded) {
            faded = document.createElementNS('http://www.w3.org/2000/svg', 'g');
            faded.id = 'faded-group';
            this.root.appendChild(faded);
        }
        this.root.querySelectorAll(':scope > g.node').forEach(n => { if (!keep.has(n.id))
            faded.appendChild(n); });
    }
    highlightEdges(test) {
        this.edges.forEach(e => { const [inc, out] = test(e); if (inc)
            e.classList.add('incoming'); if (out)
            e.classList.add('outgoing'); });
    }
    navigate(cell) {
        try {
            const node = cell.closest('.node');
            const filePath = node?.getAttribute('data-path');
            if (!filePath)
                return;
            const m = /(\d+):(\d+)_(\d+)$/.exec(cell.id);
            if (!m)
                return;
            const line = Number(m[2]);
            const ch = Number(m[3]);
            if (typeof globalThis.acquireVsCodeApi === 'function') {
                globalThis.acquireVsCodeApi().postMessage({ command: 'go to definition', path: filePath, ln: line, col: ch });
            }
        }
        catch { }
    }
}
globalThis.CallGraph = InlineCallGraph;
export {};
